import React from "react";
import Avatar from "./avatar"
import "./style.css";



function Card({c}) {
  return (
    <div>
      <h1>abc</h1>
      <div className="card">
        <div className="top">
          <h2 className="name">{c.name}</h2>
          <Avatar url={c.url} />
        </div>
        <div className="bottom">
          <p className="info">{c.phoneno}</p>
          <p className="info">{c.email}</p>
        </div>
      </div>
    </div>
  );
}

export default Card;
